import React from 'react'

const ProjectContainer = () => {
    const projects=[
        {img: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.istockphoto.com%2Fphotos%2Fwebsite-builder&psig=AOvVaw2I1w8PG4PhnMgPvI7aUIZq&ust=1704050648469000&source=images&cd=vfe&opi=89978449&ved=0CBIQjRxqFwoTCNDSjsLxt4MDFQAAAAAdAAAAABAD",
        title: "Web Page Builder Using HTML, CSS, JavaScript an PHP",
        desc:"This Web Application is very simple to the  User can just Drag and Drop the Layouts and Template to Create a Web Site",
        link:"www.google.com",
        },
    {
        img: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pcmag.com%2Fpicks%2Fbest-text-to-speech-tools&psig=AOvVaw3rVtWHIXSpXHUJaUCe8wPR&ust=1704050767338000&source=images&cd=vfe&opi=89978449&ved=0CBIQjRxqFwoTCMjEqPzxt4MDFQAAAAAdAAAAABAD",
        title: "A PDF Text Reader Using Pyton ",
        desc:"The PDF reader Using TKinter and PYPDF Libraries and User can adjust the no of lines and changes speaker",
        link:"www.google.com",
},
    {
        img: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fmedium.com%2Fanalytics-vidhya%2Fmulti-class-text-classification-practical-guide-to-machine-learning-6002bcadbd51&psig=AOvVaw2WzrQBK0TE81PsLwFrLh5y&ust=1704050796178000&source=images&cd=vfe&opi=89978449&ved=0CBIQjRxqFwoTCKDHs4zyt4MDFQAAAAAdAAAAABAD",
        title: "A Multi Label Text Classification Using Python",
        desc:"Predict the title for the relevant articles Using the Machine Learning Model Relu",
        link:"www.google.com",
},
    {
        img: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.geeksforgeeks.org%2Fvideos%2Fdiabetes-prediction-in-machine-learning%2F&psig=AOvVaw2JlJNPjViJnGGI4VpAPxjm&ust=1704050890467000&source=images&cd=vfe&opi=89978449&ved=0CBIQjRxqFwoTCNiM-rXyt4MDFQAAAAAdAAAAABAI",
        title: "Diabetes Prediction Using Python",
        desc:"Make Predict Diabetes and Deployed in Ms Azure Cloud",
        link:"www.google.com",
    },
   {
        img: "https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.wix.com%2Fblog%2Fbest-portfolio-websites&psig=AOvVaw3evBpdHjcoxJlkLg4Vnd58&ust=1704050922355000&source=images&cd=vfe&opi=89978449&ved=0CBIQjRxqFwoTCNCPldLyt4MDFQAAAAAdAAAAABAD",
        title: "Portfolio Web Page Using HTML, CSS, Javascript and React",
        desc:"Portfolio desscribes about the skills, Projects and Experience",
        link:"www.google.com",
   },];
    
  return (
    <Element className="projectContainer" id='projects'>
        <h1>Projects</h1>
        <p>Here are some projects which I have done.</p>
        <div className='projectsContainer__projects'>
{
    projects.map((project, index)=> {
        return(
            <Project key={index} img={project.img} title={project.title} desc={project.desc} link={project.link} />
        );
    })
}
        </div>
    </Element>
  );
};

export default ProjectContainer
